import React from 'react'
import './style/watch.css'

class Movielist extends React.Component {


    change() {
        let movies = window.prompt("Type de films die je later wil kijken elke film achter komma")
        let nocomma = movies.replace(/,/g, ' ')
        let res = nocomma.split(" ");

        console.log(res)
    }

    render() {
        let movies = ["a","b","c","d","e"]
        let movieListEllement = [];

        for (const [index,value] of movies.entries()) {
            movieListEllement.push(<div id="movie" key={index}>{value}</div>)
        } 
        return(
            <div>
            <button onClick={this.change}>change</button>
            <button>Save</button>
             <div id="watch">
                {movieListEllement}
            </div>
            </div>

        )
    }
}

export default Movielist;
